class Ecosystem {
    constructor(id, name, coinId) {
        this.id = id;
        this.name = name;
        this.coinId = coinId;
    }
}

const ada = new Ecosystem('Cardano', 'cardano');
const ardana = new Ecosystem('Ardana', 'ardana');
const meld = new Ecosystem('Meld', 'meld');
const wmt = new Ecosystem('World Mobile', 'world-mobile-token');
const wrt = new Ecosystem('Wing Riders', 'wingriders');
const liqwid = new Ecosystem('Liqwid', 'liqwid-finance');
const pavia = new Ecosystem('Pavia', 'pavia');
const copi = new Ecosystem('Cornucopias', 'cornucopias');
const vyfi = new Ecosystem('VYFinance', 'vyfinance');
const sundae = new Ecosystem(10, 'SundaeSwap', 'sundaeswap');
const solana = new Ecosystem(11, 'Solana', 'solana');
const ethereum = new Ecosystem(12, 'Ethereum', 'ethereum');
const bitcoin = new Ecosystem(13, 'Bitcoin', 'bitcoin');
const algorand = new Ecosystem(14, 'Algorand', 'algorand');
const ripple = new Ecosystem(15, 'XRP', 'ripple');
const binance = new Ecosystem(16, 'BNB', 'binancecoin');
const avalanche = new Ecosystem(17, 'Avalanche', 'avalanche-2');
const chainlink = new Ecosystem(18, 'Chainlink', 'chainlink');
const ape = new Ecosystem(19, 'ApeCoin', 'apecoin');
const sandbox = new Ecosystem(20, 'Sandbox', 'the-sandbox');
const aave = new Ecosystem(21, 'AAVE', 'aave');
const decentraland = new Ecosystem(22, 'Decentraland', 'decentraland');
const polygon = new Ecosystem(23, 'Polygon', 'matic-network');
const polkadot = new Ecosystem(24, 'Polkadot', 'polkadot');
const cosmos = new Ecosystem(25, 'Cosmos', 'cosmos');
const minswap = new Ecosystem(26, 'Minswap', 'minswap');
const clay = new Ecosystem(27, 'Clay', 'clay-nation');
const apeSociety = new Ecosystem(28, 'Society', 'the-ape-society');


const tokenArray = [
    apeSociety,
    clay,
    minswap,
    polygon,
    polkadot,
    cosmos,
    ripple,
    binance,
    avalanche,
    chainlink,
    ape,
    sandbox,
    aave,
    decentraland,
    ada,
    ardana,
    meld,
    wmt,
    wrt,
    liqwid,
    pavia,
    copi,
    vyfi,
    sundae,
    solana,
    bitcoin,
    ethereum,
    algorand
  ];
  const tokenSortList = tokenArray.sort((a, b) => (a.name < b.name ? -1 : 1));


export default tokenSortList;
